import "./styles/Support-Ethiopia.css"
import "./styles/Support-Rehoboth.css"

export default function Support_Ethiopia() {
    return (
        <div>
            <Top/>
            <BodyEth/>
        </div>
    )
}

const Top = () => {
    return (
        <div className="ethiopia-top">
            <p>Show your support</p>
            <button>Give</button>
        </div>
    )
}

const BodyEth = () => {
    return (
        <div className="ethiopia-body">

        </div>
    )
}
